import {
    Radar,
    RadarChart,
    PolarGrid,
    PolarAngleAxis,
    PolarRadiusAxis,
  } from "recharts"; // Remove ResponsiveContainer do import
  
  function SkillsChart() {
    const data = [
      { skill: "JavaScript", A: 90, fullMark: 100 },
      { skill: "React", A: 85, fullMark: 100 },
      { skill: "HTML/CSS", A: 95, fullMark: 100 },
      { skill: "UI/UX", A: 75, fullMark: 100 },
      { skill: "Node.js", A: 60, fullMark: 100 },
      { skill: "Inglês", A: 80, fullMark: 100 },
    ];
  
    return (
      // Remova a div que envolvia o ResponsiveContainer
      <RadarChart cx="50%" cy="50%" outerRadius="80%" data={data} width={500} height={300}> {/* Defina width e height fixos aqui */}
        <PolarGrid />
        <PolarAngleAxis dataKey="skill" />
        <PolarRadiusAxis />
        <Radar
          name="Habilidades"
          dataKey="A"
          stroke="#2563eb"
          fill="#2563eb"
          fillOpacity={0.6}
        />
      </RadarChart>
    );
  }
  
  export default SkillsChart;
